    public int Solution(int n, int k, int[] arr) {
        int max = 0;
        int sum = 0;
        int zeroCnt = 0;

        for (int j=0; j<n-k+1; j++) {
            // j = 슬라이드 시작지점

            System.out.println("슬라이드 시작지점 j = " + j);
            System.out.println("----------------");

            for (int h=j; h<n-k+1; h++) {

                System.out.println("h = " + h);
                System.out.println("n-k = " + (n-k));
                System.out.println("arr[j] = " + arr[h]);
                System.out.println("arr[j+1] = " + arr[h+1]);
                System.out.println("----------------");

                if ((arr[h] != 0) && (zeroCnt<k)) {
                    sum++;
                    System.out.println("111111111111");
                    System.out.println("sum = "+sum);
                    System.out.println();
                } else if ((arr[h] == 0) && (zeroCnt<k)) {
                    zeroCnt++;
                    sum++;
                    System.out.println("222222222222222");
                    System.out.println("zeroCnt = "+zeroCnt);
                    System.out.println("sum = "+sum);
                    System.out.println();
                } else if ((zeroCnt==k) && (arr[h] == 1) && (arr[h+1] == 1)) {
                    sum++;
                    System.out.println("3333333333333333");
                    System.out.println("zeroCnt = "+zeroCnt);
                    System.out.println("sum = "+sum);
                    System.out.println();
                } else if ((zeroCnt==k) && (arr[h] == 0) && (arr[h+1] == 0)){
                    System.out.println("4444444444444444");
                    System.out.println("----------------");
                    System.out.println(max);
                    System.out.println(sum);
                    System.out.println(zeroCnt);
                    System.out.println();

                    if (max < sum) {
                        max = sum;
                    }
                    sum = 0;
                    zeroCnt = 0;

                    break;
                } else if ((zeroCnt==k) && (arr[h] == 1) && (arr[h+1] == 0)){
                    sum++;
                    System.out.println("55555555555");
                    System.out.println("----------------");
                    System.out.println(max);
                    System.out.println(sum);
                    System.out.println(zeroCnt);
                    System.out.println();

                    if (max < sum) {
                        max = sum;
                    }
                    sum = 0;
                    zeroCnt = 0;

                    break;
                }

            }
            sum = 0;
        }
        return max;
    }

